Sexy Asia Carrera stars as a novelist who inherits her Aunt's estate without knowing the woman was a witch. But Auntie is far from dead... she wants Asia for a virginal sacrifice! Poor Asia, everyone is out to get her, even her curvy Realtor Rayveness. Evil Auntie plies her with sexual visions, and even charms a neighborhood party into a hedonistic orgy! Tension mounts as Asia sleepwalks to a sacrificial alter for her dramatic de-flowering. If you like story-lines with your porn then Adam &amp; Eve is where it's all at!

Asia Carrera, Anna Malle, Alexandra Silk, Julie Meadows, Cheyenne Silver, Rayveness
